nav.scrolled .links li.contact--link a span {
  opacity: 0;
  transition: var(--nav-scrolled--animation) all;
}
.nav--circl {
  position: absolute;
  right: 0;
  background-color: var(--main-color);
  transform: scale(0);
  transition: 350ms transform;
  background-color: var(--main-color);
  top: 0;
  display: grid;
  grid-template-columns: 1fr;
  grid-template-rows: auto 0fr;
  cursor: pointer;
  justify-items: end;
  border-radius: 35px;
}
nav.scrolled .nav--circl.closed {
  transition: var(--nav-scrolled--animation) all var(--nav-timing-function);
}
.nav--circl.active {
  transform-origin: right top;
  grid-template-rows: auto 1fr;
  transition: var(--nav-scrolled--animation) all var(--nav-timing-function);
}
.nav--circl.active ul {
  width: min(300px, 70vw);
  padding-block: 25px;
}
.side--nav .title {
  font-size: 14px;
  color: #989898;
}
.side--nav li {
  padding: 10px 30px;
  position: relative;
  transition-duration: 750ms;
}
.side--nav li:not(.title)::after {
  content: "";
  transition-duration: inherit;
  transition-property: background-color;
  position: absolute;
  height: 10px;
  aspect-ratio: 1;
  background-color: transparent;
  border-radius: 50%;
  right: 40px;
  top: 50%;
  transform: translateY(-50%);
}
.side--nav li:hover::after {
  background-color: var(--bg-lines);
}
.side--nav li:not(.title):hover a {
  color: var(--bg-lines);
}
.side--nav a {
  transition-duration: inherit;
  transition-property: color;
  color: var(--bg-lines);
  text-decoration: none;
}
.nav--circl ul {
  display: flex;
  flex-direction: column;
  gap: 9px;
  width: 35px;
  font-size: 21px;
  color: #fff;
  transition: var(--nav-scrolled--animation) all var(--nav-timing-function);
  list-style: none;
}
.nav--circl > * {
  overflow: hidden;
}
.nav--circl .lines {
  border-radius: 50%;
  aspect-ratio: 1;
  height: 61px;
  display: flex;
  flex-direction: column;
  gap: 5px;
  justify-content: center;
  align-items: center;
}
.nav--circl .lines > div {
  transition: var(--nav-scrolled--animation) all;
  width: 50%;
  height: 3px;
  background-color: var(--bg-lines);
}

.nav--circl.active .lines div:nth-child(1) {
  transform: rotate(45deg) translateX(6px);
}
.nav--circl.active .lines div:nth-child(2) {
  transform: rotate(-45deg) translateX(6px);
}

nav.scrolled .nav--circl {
  transform: scale(1);
}
@keyframes scale {
  100% {
    transform: scale(0);
  }
}
.nav--links a {
  text-decoration: none;
  color: var(--main-color);
  color: inherit;
  padding: 5px 10px;
  border-radius: 35px;
}

[text-flip] {
  position: relative;
  overflow: hidden;
  transition: 300ms all;
  display: block;
}
[text-flip]::after {
  content: attr(content);
  position: absolute;
  width: 100%;
  top: 50%;
  left: 0;
  left: 50%;
  transform: translate(-50%, 50%);
  transition: inherit;
  background-color: var(--main-color);
  color: #fff;
  padding: inherit;
  border-radius: inherit;
}
.contact--link [text-flip]::after {
  background-color: var(--secund-color);
  color: var(--main-color);
}
[text-flip] .text {
  position: relative;
  transition: inherit;
  display: inline-block;
}
[text-flip]:hover .text {
  transform: scale(0);
}
[text-flip]:hover::after {
  transform: translate(-50%, -50%);
}
.flip--parent:hover [text-flip]:not(.clone) {
  transform: translateY(-150%);
}
.clone {
  position: absolute;
  top: 50%;
  transform: translateY(50%);
}
.contact--link a {
  font-size: 21px;
  overflow: hidden;
}
.contact--link a {
  background-color: transparent;
  color: var(--main-color);
  border: 2px solid var(--main-color);
  border-radius: 50px;
  animation: nav--animation 2s forwards;
  padding: 10px 25px;
}
.contact--link:hover a {
  border: 2px solid(--secund-color);
}
.contact--link a {
  overflow: hidden;
}

@keyframes nav--scrolled {
  100% {
    transform: translateY(-100%);
  }
}

